self.onmessage = (event) => {
    const { type, payload } = event.data;
    switch (type) {
        case 'START':
            startTracking();
            break;
        case 'STOP':
            stopTracking();
            break;
        case 'POSITION_UPDATE':
            handlePositionUpdate(payload);
            break;
    }
};
